import { ArrowRightIcon, SunIcon, MoonIcon } from "@heroicons/react/solid";
import { useEffect,useState } from "react";
import React from "react";
import {
    Link
  } from "react-router-dom";

export default function Navbar() {

  return (
    <section className="bg-gray-200 md:sticky top-0 z-10">
      <div className="container mx-auto flex flex-wrap px-5 py-4 flex-col md:flex-row items-center text-black">
        <a className="title-font font-medium text-black mb-4 md:mb-0">
          <Link to="/" className="ml-3 text-xl">
            Food Delivery
          </Link>
        </a>
        <nav className="md:mr-auto md:ml-4 md:py-1 md:pl-4 md:border-l md:border-gray-700	flex flex-wrap items-center text-base justify-center">
          <Link to="/projects" className="mr-5 hover:text-black">
            Past Work
          </Link>
          <Link to="/skills" className="mr-5 hover:text-indigo-700">
            Skills
          </Link>
          <Link to="/testimonials" className="mr-5 hover:text-black">
            Testimonials
          </Link>
        </nav>
        <Link
          to="/contact"
          className="inline-flex items-center bg-gray-800 border-0 py-1 px-3 focus:outline-none hover:bg-gray-700 rounded text-base mt-4 md:mt-0">
          Work with us
          <ArrowRightIcon className="w-4 h-4 ml-1" />
        </Link>
      </div>
    </section>
  );
}
